INSERT INTO `news` (`id`, `title`, `src`, `type`, `created_at`, `updated_at`, `archived_at`, `icon`) VALUES
(1, 'Жителям Центрального райна!', '<p>По информации ПАО \"Т Плюс\", в связи с повреждением на теплосети, ремонтные работы и отключение ГВС продлены до 17:00 29.05.22 г. по следующим адресам:</p>\r\n<ul>\r\n<li>ул. Карбышева, 13, 11</li>\r\n<li>ул. Баныкина, 68</li>\r\n</ul>\r\n<p>Приносим свои извинения за временные неудобства.</p>', 'tenants', '2022-05-24 12:14:43', '2022-06-11 12:14:43', NULL, );
INSERT INTO `news` (`id`, `title`, `src`, `type`, `created_at`, `updated_at`, `archived_at`, `icon`) VALUES
(2, 'С праздником, Тольятти!', '<p>Дорогие жители, поздравляем Вас с Днем города! Главное богатство Тольятти - это люди. Благодаря Вашему упорству, мужеству, уму и таланту строятся дороги и жилье, благоустраиваются дворовые и общегородские территории, формируется современная инфраструктура города.<br><br>Низкий поклон и искренние слова благодарности за Ваш созидательный труд во имя нашего совместно дела - благополучия Тольятти.<br><br>Желаем Вам крепкого здоровья, счастья и благополучия, а городу &ndash; развития и процветания.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: right;\"><em>Засульский Виктор Эдуардович (генеральный директор)</em></p>', 'tenants', '2022-06-05 02:20:38', '2022-06-13 13:23:51', NULL, );
INSERT INTO `news` (`id`, `title`, `src`, `type`, `created_at`, `updated_at`, `archived_at`, `icon`) VALUES
(3, 'С праздником, коллеги!', '<p>Дорогие коллеги, поздравляю Вас с Днем города! Главное богатство Тольятти - это люди. Благодаря Вашему упорству, мужеству, уму и таланту строятся дороги и жилье, благоустраиваются дворовые и общегородские территории, формируется современная инфраструктура города.<br><br>Низкий поклон и искренние слова благодарности за Ваш созидательный труд во имя нашего совместно дела - благополучия Тольятти.<br><br>Желаем Вам крепкого здоровья, счастья и благополучия, а городу &ndash; развития и процветания.</p>\r\n<p style=\"text-align: right;\"><em>Засульский Виктор Эдуардович (генеральный директор)</em></p>', 'staff', '2022-06-05 02:20:38', '2022-06-11 12:22:25', NULL, );
INSERT INTO `news` (`id`, `title`, `src`, `type`, `created_at`, `updated_at`, `archived_at`, `icon`) VALUES
(4, 'Мероприятия в день города', '<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" width=\"782\" height=\"1102\"></p>', 'tenants', '2022-06-05 04:10:44', '2022-06-11 12:26:14', NULL, );
INSERT INTO `news` (`id`, `title`, `src`, `type`, `created_at`, `updated_at`, `archived_at`, `icon`) VALUES
(5, 'Отключения коммунальных ресурсов', '<p>Уважаемые жители! В&nbsp;связи с проведением ремонтных работ будут отключены коммунальные ресурсы по следующим адресам:</p>\r\n<table style=\"border-collapse: collapse; width: 100%; height: 111.953px;\" border=\"1\"><colgroup><col style=\"width: 15.2796%;\"><col style=\"width: 7.09962%;\"><col style=\"width: 23.9226%;\"><col style=\"width: 17.1317%;\"><col style=\"width: 17.1317%;\"><col style=\"width: 19.4468%;\"></colgroup>\r\n<tbody>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px; text-align: center;\" colspan=\"2\"><strong>Адрес</strong></td>\r\n<td style=\"height: 44.7812px; text-align: center;\" rowspan=\"2\"><strong>Наименование ресурса</strong></td>\r\n<td style=\"height: 44.7812px; text-align: center;\" rowspan=\"2\"><strong>Период отключения</strong></td>\r\n<td style=\"height: 44.7812px; text-align: center;\" rowspan=\"2\"><strong>Причина отключения</strong></td>\r\n<td style=\"height: 44.7812px; text-align: center;\" rowspan=\"2\"><strong>Ответсвенный</strong></td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px; text-align: center;\"><strong>улица</strong></td>\r\n<td style=\"text-align: center;\"><strong>дом</strong></td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px;\">Мира</td>\r\n<td style=\"height: 22.3906px;\">137, 133</td>\r\n<td style=\"height: 22.3906px;\" rowspan=\"2\">Горячее водоснабжение</td>\r\n<td style=\"height: 22.3906px;\" rowspan=\"2\">\r\n<p>08:00 06.06.22г. до 16:00 10.06.22г.</p>\r\n</td>\r\n<td style=\"height: 22.3906px;\" rowspan=\"2\">Остановочный ремонт ЦТП-53</td>\r\n<td style=\"height: 22.3906px;\" rowspan=\"2\">Т Плюс</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px;\">Баныкина</td>\r\n<td style=\"height: 22.3906px;\">68</td>\r\n</tr>\r\n<tr style=\"height: 22.3906px;\">\r\n<td style=\"height: 22.3906px;\">Карбышева</td>\r\n<td style=\"height: 22.3906px;\">13</td>\r\n<td style=\"height: 22.3906px;\">Электроснабжение</td>\r\n<td style=\"height: 22.3906px;\">10.06.22г. 09:00-12:00</td>\r\n<td style=\"height: 22.3906px;\">ППР</td>\r\n<td style=\"height: 22.3906px;\">ВДЭО</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: center;\"><span style=\"background-color: rgb(251, 238, 184);\"><em>Приносим свои извинения за временные неудобства.</em></span></p>', 'tenants', '2022-06-05 14:34:10', '2022-06-11 12:37:46', NULL, );

